/*****************************************************
 * filter - Filter Tool
 * rev 1 - april 2022 - shabaz
 *
 * uses filter6.bin
 * The filter tch tool can be used for applying 
 * lowpass, highpass and bandpass filters.
 * The range is 25 - 15000 Hz, in 25 Hz steps. 
 * first program the DSP board EEPROM using:
 * ./eeload -p filter6.bin
 * then power-cycle the DSP board for the EEPROM
 * to be read by the DSP.
 *
 * Example to enable a low-pass response at 300 Hz:
 *      ./filter -l 300
 * Example to enable a high-pass response at 3000 Hz:
 *      ./filter -h 3000
 * Example for bandpass 300-3000Hz:
 *      ./filter -b1 300 -b2 3000
 * Example for bandpass at 1000 Hz with 500 Hz width:
 *      ./filter -b 1000 -w 500
 * the above is the same as:
 *      ./filter -b1 750 -b2 1250
 *****************************************************/

